		const stageTwoButton = this.Container2.stageTwoButton;
		const stageThreeButton = this.Container2.stageThreeButton;
		const mentalButton = this.Container2.mentalButton;
		
		const q1a1Button = this.Container2.q1a1Button;
		const q1a2Button = this.Container2.q1a2Button;
		const q1a3Button = this.Container2.q1a3Button;
		const q1a4Button = this.Container2.q1a4Button;
		const q2a1Button = this.Container2.q2a1Button;
		const q2a2Button = this.Container2.q2a2Button;
		const q2a3Button = this.Container2.q2a3Button;
		const q2a4Button = this.Container2.q2a4Button;
		const q3a1Button = this.Container2.q3a1Button;
		const q3a2Button = this.Container2.q3a2Button;
		const q3a3Button = this.Container2.q3a3Button;
		const q3a4Button = this.Container2.q3a4Button;
		
