		queue.on("complete", onQueueLoadComplete, this);
		queue.loadManifest([
			{id: "sound1", src:"sounds/streamsound39.mp3"}, 		// frames: 0 - 3384
			{id: "sound2", src:"sounds/streamsound58copy.mp3"},		// frames: 7 - 343
			{id: "sound3", src:"sounds/streamsound58.mp3"},			// frames: 348 - 1689
			{id: "sound4", src:"sounds/sound404.mp3"},				// frames: 1690 - 1726
			{id: "sound5", src:"sounds/sound405.mp3"}				// frames: 1731 - 1772
		]);
		var soundData = [
			{low: 0, 	high: 3384, id: "sound1", src:"sounds/streamsound39.mp3", container: Container},
			{low: 7, 	high: 337, 	id: "sound2", src:"sounds/streamsound58copy.mp3", container: Container2},
			{low: 350, 	high: 1689, id: "sound3", src:"sounds/streamsound58.mp3", container: Container2},
			{low: 1690, high: 1726, id: "sound4", src:"sounds/sound404.mp3", container: Container2},
			{low: 1731, high: 1772, id: "sound5", src:"sounds/sound405.mp3", container: Container2}
		];
		
